import Card from './Card';

export default function Cards(props) {
   
   return <div>
      {props.characters.map(card => <Card key = {card.name} name={card.name} status={card.status} species={card.species} gender={card.gender}origin={card.origin.name} image={card.image}/>)}
   </div>;
}
